const Logo = () => (
    <div>
        <div className="logo">
            <h2 className="logo">JAI PARAKH</h2>
            <p>Fullstack Developer | Mentor | Jedi</p>
        </div>
        <style jsx>{`
            .logo{
                font-size: 4rem;
                font-family: 'Abril Fatface';
            }
        `}</style>
    </div>
)

export default Logo;
